#!/usr/bin/env ruby

def react?(a, b)
  return false if b.nil?
  return false if a == b
  return true if (a.upcase == b) || (b.upcase == a)
  false
end

def do_react(seq)
  # destructively apply reactions to seq linearly
  i = 0
  loop do
    if react?(seq[i], seq[i+1])
      $stderr.puts "matched #{seq[i]} and #{seq[i+1]}"
      seq.delete_at(i)
      seq.delete_at(i)
      if i > 0
        # if we deleted stuff, new pairs may match up so go backwards 1
        i -= 1
      end
    else
      i += 1
      break if i >= seq.size
    end
  end
  return seq
end

if __FILE__ == $0
  sequence = DATA.readlines[0].chomp.chars.freeze
  reduced = do_react(sequence.dup)*''
  $stderr.puts reduced
  puts "\npart 1: #{reduced.size}"

  letters = sequence.uniq
  best = letters.uniq.map { |letter| do_react(sequence.select { |x| x.upcase != letter.upcase }).size }.min
  puts "\npart 2: #{best}"
end


__END__


